class Solution {
public:
    vector<int> maxScoreIndices(vector<int>& nums) {
        int n = nums.size();
        vector<int> sums(n+1);
        sums[0] = 0;
        for (int i = 0; i < n; i++) {
            sums[i+1] = sums[i] + nums[i];
        }
        int high = 0;
        vector<int> ans;
        for (int i = 0; i <= n; i++) {
            int score = (i+1) - sums[i] + (sums[n]-sums[i]);
            // printf("%d ", score);
            if (score > high) {
                high = score;
                ans.clear();
            }
            if (score == high) {
                ans.push_back(i);
            }
        }
        return ans;
    }
};
